B.FJ=new A.k2("Wear comfortable loose fitting clothes. You will want to be comfortable, and most likely your vital signs will monitored (for example, blood pressure, heart rate, respiratory rate (breathing  rate), or a cardiac monitor may be attached to your chest). Every infusion center is different, so check with yours in regard to what to expect. Wearing loose fitting clothes allows the medical staff to easily and properly monitor your vital signs.","assets/images/comfortclothes.png",null)
