B.FL=new A.k2("Consider wearing clothing with layers to allow for temperature control. The temperature of the infusion center may be cool or warm; also some intravenous infusions can make you feel either warm or cool. Having layers of clothing allows you the flexibility too easily control your comfort zone.","assets/images/comfortclothes.png",null)
